'use client'

import React, { useEffect, useState } from 'react'

export function SideNav() {
  const [currentComponent, setCurrentComponent] = useState<string | null>(null)

  const handleScroll = () => {
    const elementsUnderNav = document.elementsFromPoint(
      window.innerWidth / 2,
      150,
    )
    const foundComponent = elementsUnderNav.find((el) => el.hasAttribute('id'))

    // Update the state with either the component name or null
    setCurrentComponent(
      foundComponent ? foundComponent.getAttribute('id') : null,
    )
    console.log(foundComponent)
  }

  useEffect(() => {
    window.addEventListener('scroll', handleScroll)
    return () => {
      window.removeEventListener('scroll', handleScroll)
    }
  }, [])

  return (
    <div className={`${currentComponent ? '' : 'xs:hidden 2xl:fixed'}`}>
      <div
        className={`${
          currentComponent === 'footer' || currentComponent === 'hero'
            ? 'opacity-0'
            : 'ease-in-out" inline opacity-100 transition-opacity duration-[350ms]'
        }`}
      >
        <div className="fixed left-10 top-96 z-40">
          {currentComponent === 'what-we-do' ? <Selected /> : <Line />}
          {currentComponent === 'continuum-matrix' ? <Selected /> : <Line />}
          {currentComponent === 'use-cases' ? <Selected /> : <Line />}
          {currentComponent === 'faq' ? <Selected /> : <Line />}
        </div>
      </div>
    </div>
  )
}

